import Home from './Pages/Home';
import {BrowserRouter as Router, Route, Switch} from 'react-router-dom';
import './App.css';
import Login from "./Pages/Login";
import Nav from './Components/Navbar';


function App() {
  return (
    // <div className="App">

    <Router>

      <Switch>

         <Route path="/"   />
         <Route path="/Login" />

      </Switch>
    </Router>

    // </div>
  );
}

export default App;
